import axios from "axios";

class RestClient {

    static GetRequest(getUrl) {
        return axios.get(getUrl).then(response => {
            return response.data
        }).catch(error => {
            return null;
        })
    }
    static PostRequest = ({postURL,postJson})=>{
        return axios.post(postURL,postJson)
        .then(res=>{
            return res.data
        })
        .catch(err=>{
        return null;
        });
    }


}

export default RestClient;
